  \"A Survey of the Fish and Macroinvertebrate Communities of the Silvio Conte National
  Wildlife Refuge Lands in the Nulhegan Drainage and the West Mountain Wildlife Management
  Area\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:26.896693\",\n\t\"name\":
  \"a-survey-of-the-fish-and-macroinvertebrate-communities-of-the-silvio-conte-national-wildli\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report presents the results from the
  following: 1) A fish species inventory of running and standing waters. 2) An analysis
  of these data indicating an estimate of existing running-water fish assemblage types
  using a modification of the classification presented in The Classification of Lhe
  Aquatic Communities of Vermont; 3) An evaluation of fish assemblage health as measured
  by the VTDEC protocols (through use of Indexes of Biotic Integrity) for each wadeable
  hard-bottomed stream site; 4) Estimates of Atlantic salmon parr and smolt production
  in the Nulhegan River and Paul Stream sub basins; 5) A macroinvertebrate assemblage
  survey of running waters. 6) An analysis of these data indicating an estimate of
  existing running-water macroinvertebrate assemblage types as presented in The Classification
  of the Aquatic Communities of Vermont; 7) An evaluation of the macroinvertebrate
  assemblage health or biological integrity as measured by the Vermont Department
  of Environmental Conservation protocols for each wadeable \"riffle\" stream site;
  8) An inventory of the macroinvertebrate Molluscan fauna, from both flowing and
  standing waters.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
